import React from "react";
import './experienceCard.css'; 

const ExperienceCard = ({ role, company, dates, description }) => {
    const descriptionBullets = description.map((item) => {
        <li key={item.uniqueId}>{item}</li>
    })
    return (
        <div className="experienceText">
            <h3>{role}</h3>
            <div id="subdataSection">
                <p className="experienceSubdata">{company}</p>
                <p className="experienceSubdata">{dates}</p>
            </div>
            <ul>{descriptionBullets}</ul>
        </div>
    )
}

export default ExperienceCard;
